$(document).ready((function(){(()=>{const t=document.querySelector(".hamburger"),e=document.querySelector(".nav-links");t.addEventListener("click",()=>{t.classList.toggle("is-active"),e.classList.toggle("nav-active")})})(),$("#homeBtn").click(()=>{window.location="index.html"}),$("#contactBtn").click(()=>{window.location="contact.html"});let t=document.getElementsByClassName("artistImg");for(let e=0;e<t.length;e++)t[e].addEventListener("mouseover",(function(){t[e].classList.add("animated","jackInTheBox")}));for(let e=0;e<t.length;e++)t[e].addEventListener("animationend",(function(){t[e].classList.remove("animated","jackInTheBox")}))}));